import '../css/PaginaNonTrovata.css';

const PaginaNonTrovata = () => {
    return ( 
        <div className="PaginaNonTrovata">
            <h1 id='nonTrovata'><span>404</span></h1>
            <h2 id='noTrovata'><span>Pagina non trovata</span></h2>
        </div>
    );
}
 
export default PaginaNonTrovata;
